import React from "react";
import logo from '../../assets/images/prancheta.png';

export default (props) => 
  <aside className="logo">
    <a href="/" className="logo">
      <img src={logo} alt="logo" />
    </a>
    <h1>Lista de esetoque</h1>
  </aside>
